import Navbar from "./components/navbar/Navbar";
import Warden from "./pages/warden/Warden";
import { useState } from "react";

function App() {
  const [menuOpen, setMenuOpen] = useState(false);
  return <div>
            <Navbar menuOpen={menuOpen} setMenuOpen={setMenuOpen}/>
        </div>;
}

export default App;
